import React from 'react';
import BooksFetcher from '../books-api/BooksFetcher';
import BooksSlider from '../components/BooksSlider';

const HomePage = () => {
    return (
        <div>
            {/* Получение данных о бестселлерах */}
            <BooksFetcher category="bestsellers">
                {(books) => (
                    <BooksSlider books={books} category="Bestsellers" />
                )}
            </BooksFetcher>

            {/* Получение данных о новинках */}
            <BooksFetcher category="new-releases">
                {(books) => (
                    <BooksSlider books={books} category="New Releases" />
                )}
            </BooksFetcher>
        </div>
    );
};

export default HomePage;
